import React from 'react';

function Education() {
  return (
    <div className="education">
      <h2>Education</h2>
      <div className="activity">
        <strong>Ajou University (아주대학교) | 2020.03 - 2024.03</strong>
        <p>Blockchain Academic group based at Seoul National University</p>
        <ul>
            <li><strong>Early Graduation (조기 졸업)</strong></li>
            <li><strong>GPA</strong> | 4.20 / 4.50</li>
          </ul>
      </div>
    </div>
  );
}

export default Education;
